import './App.css';
import React from 'react';
import { useEffect } from 'react';
import { ReactDOM, render } from 'react-dom';
import { useState } from 'react';
// const [left_right,lr_value]=useState(30) ;
function Redcar(){
  
  return((<section style={{display:"flex"}}>
  <div className='redcar'
  
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+(5)+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(-8)+"vh",}}> 
</div>

<div className='redcar'
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+(5)+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(-20)+"vh",}}> 
</div>
<div className='redcar'
  
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+((5))+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(-40)+"vh",}}> 
</div>

<div className='redcar'
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+(5)+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(-60)+"vh",}}> 
</div>
<div className='redcar'
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+(5)+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(-80)+"vh",}}> 
</div>

</section>
))}
function All_car(){
  
  return((
  <div>
    <Redcar />
    
  </div>
        ))}
function GameStatus() {var over=false;
  
          useEffect(() => { 
          
        
        
            const checkCollision = () => {
              const array = document.getElementsByClassName('redcar');
              const mx = document.getElementById('main').getBoundingClientRect().x;
              const my = document.getElementById('main').getBoundingClientRect().y;
              for (let i = 0; i < array.length; i++) {
        
                const x = array[i].getBoundingClientRect().x;
                const y = array[i].getBoundingClientRect().y;
                if (Math.abs(mx - x) <= 30 && Math.abs(my - y) <= 20) {
                  // alert('Shapes are touching!');
                  console.log("GAME OVER!")
        
                  Stop();
                  return(<div style={{padding:"100px",
                backgroundColor:"green"}}> GAME OVER!</div>)
                  // Stop checking if a collision is detected
                }
              }
            };
        
            const interval = setInterval(checkCollision, 60);
        
            return () => clearInterval(interval);
          }, []);
        
          return (
            <div>
              {/* Assuming you have elements with class 'redcar' and an element with id 'main' */}
            </div>
          );
        }
function Turn_left(){const [left_right,lr_value]=useState(30) ;
          if (left_right>2){ 
            lr_value(left_right-3)
            console.log(left_right)}
          }
function Turn_right(){
  const [left_right,lr_value]=useState(30) ;
  if (left_right<62){
            lr_value(left_right+3)
            console.log(left_right)}
          }

function App() {
  var [button,buton_value]=useState(0);
  // const [left_margin,margin_value]=useState(Math.random()*70);
const left_margin=(Math.random()*70);
  
function Onclick(){
  // GameStatus();
buton_value(button + 1)
}
function Stop(){buton_value(0);
  return;

}
  return (
    
    <body className='body'>
      
      <header className='header'>
        <img className='logo1' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        <h2>Tinny cars</h2>
        <img className='logo2' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        </header>
      <nav className='nav'>
        <h1><a>Login</a></h1>
        <h1><a>Home</a></h1>
        <h1><a>About</a></h1>
      </nav> 

      <div className='body'>
        <section className='road'>
        <button style={{
          position:'relative',
          zIndex:"10"
          }} onClick={Onclick}>score :{button}</button>
        <section className='running_cars'>
          
            <All_car />
            
            

          </section>
          <GameStatus/>
          <nav  className='main_car' id="main" style={{ position :"relation" ,zIndex:"20",marginLeft: left_right+"vw"}}>
          </nav>

          <div >
             <div className='bottom'>
             <button className='leftbutton' onClick={Turn_left}></button>
              <button className='rightbutton' onClick={Turn_right}></button></div>
          </div>
          </section>
          </div>
      <footer>Footer</footer>

    </body>
  
    
  );
}

export default App;
